    if (current_date.getTime() >= expected_date.getTime()) {
      expected_date.setUTCDate(expected_date.getUTCDate() + 1);
    }
    const milliseconds = expected_date.getTime() - current_date.getTime();
    const hours = Math.floor(milliseconds / 36e5);
